@import '/app/assets/scss/animations.scss';
@import '/app/assets/scss/grid.scss';

.header {
  flex: 0 0 auto;
  width: 100%;
  height: 143px;
  display: flex;
  flex-flow: row nowrap;
  justify-content: space-around;
  background-color: #1f1f1f;
  padding: 20px 30px;
  max-width: 100%;

  @extend .grid--row;

  &__left {
    text-align: center;
    margin-right: auto;
  }

  &__left,
  &__right {
    display: flex;
    flex-flow: row wrap;
    align-items: center;
  }

  &__logo {

    &:hover {
      svg {
        @extend .anim--shake;
      }
    }
  }
}
